import './app.css';
import Navbar from './Components/Navbar'
import Contents from './Components/Contents'
import MainDetail from './Components/MainDetail';
import { mainDetail } from "./data/mainDetail.js"
import React, { Fragment } from 'react';

function DetailContents({mainDetail}){
  const result = [];
  item.array.forEach(item => {
    result.push(<MainDetail content={mainDetail} key={mainDetail.id} />)
    
  });
  return(
    <>
      {result}
    </>
  )
}

function App() {
  return (
    <>
    <Navbar/>
    <Contents/>
    <DetailContents mainDetail={mainDetail}/>
    </>
  );
}

export default App;
